import React, { useState } from "react";
import UserForm from "./components/UserForm";
import UserList from "/components/UserList";

function App() {
  const [users, setUsers] = useState([]);

  const addUser = (user) => {
    setUsers([...users, user]);
  };

  return (
    <div className="App">
      <UserForm addUser={addUser} />
      <UserList users={users} />
    </div>
  );
}
export default App
